#[derive(Default, Builder, Debug, Clone)]
pub struct TurnActions {
  pub player_id: i64,
  pub day: i64,
  // Tag("a:a:3:{")
  // Array{player ID, day, array_of_actions}
  /// These strings are in json format
  pub actions: Vec<serde_json::Value>,
}

pub fn read_turn_actions(input: &str) -> IResult<&str, TurnActions> {
  let (input, player_id) = terminated(preceded(tag("p:"), i64), tag(";"))(input)?;
  let (input, day) = terminated(preceded(tag("d:"), i64), tag(";"))(input)?;
  let (input, _start_of_turn_actions) = tag("a:a:3:{")(input)?;
  let (input, _index_0) = read_i64(input)?;
  let (input, _player_id) = read_i64(input)?;
  let (input, _index_1) = read_i64(input)?;
  let (input, _day) = read_i64(input)?;
  let (input, _index_2) = read_i64(input)?;
  let (input, _array) = tag("a:")(input)?;
  let (input, length_of_actions) = read_next_length(input)?;
  let (input, _) = tag("{")(input)?;

  // Sanity Asserts
  {
    assert_eq!(_index_0, 0);
    assert_eq!(_index_1, 1);
    assert_eq!(_index_2, 2);

    assert_eq!(player_id, _player_id);
    assert_eq!(day, _day);
  }

  let mut turn_actions_builder = TurnActionsBuilder::default();
  turn_actions_builder.player_id(player_id);
  turn_actions_builder.day(day);

  let mut actons = Vec::new();
  let mut input_loop = input;

  for _i in 0..length_of_actions {
    let input = input_loop;
    let (input, _action_index) = read_i64(input)?;
    let (input, action_json) = read_string(input)?;

    actons.push(serde_json::from_str(action_json).unwrap());

    input_loop = input;
  }

  let input = input_loop;
  let (input, _) = tag("}}")(input)?;

  turn_actions_builder.actions(actons);

  Ok((input, turn_actions_builder.build().unwrap()))
}

